import React, { PureComponent } from 'react'

export default class TransitionGroupDome extends PureComponent {
  constructor (props) {
    super(props)

    this.state = {
      names: ["coderwhy", "kobe", "lilei"]
    }
  }

  render() {
    return (
      <div>
        {
          this.state.names.map((item, index) => {
            return (
              <div>{item}</div>
            )
          })
        }
      </div>
    )
  }
}
